import React from "react";
import styled from "styled-components";
import Profile from "./Profile";
const Wrapper = styled.section`
  display: inline-block;
  justify-content: stretch;
  height: 100%;
  width: 100%;
`;

const home = (props) => {
  return (
    <Wrapper>
      <Profile />
    </Wrapper>
  );
};

export default home;
